import Cake from "./Cake";
function CakeList() {
    const cakes = [
        {
            name:"Choco Truffle cake",
            price:"43.33",
            image:"truffle.png"
        },
        {
            name:"Buttercream cake",
            price:"50.33",
            image:"buttercream.webp"
        },
        {
            name:"Macarone cake",
            price:"100",
            image:"macarone.jpg"
        },
        {
            name:"Macarone cake",
            price:"100",
            image:"macarone.jpg"
        }, 
        {
            name:"Buttercream cake",
            price:"50.33",
            image:"buttercream.webp"
        },
    ];

    return (
        <div style={{display:"flex"}}>
            {cakes.map((cake, index) => {
                return <Cake cake={cake} key={index}/>
            })}
        </div>
    )
}

export default CakeList;
